// Update the cart
function updateCartView(cart) {
    const itemsContainer = document.getElementById("cart-items-list");
    const totalPriceElement = document.getElementById("total-price");
    let totalPrice = 0;
    itemsContainer.innerHTML = ""; // Clear only the items list
    if (cart.length > 0) {
        cart.forEach((item) => {
            const itemContainer = document.createElement("div");
            itemContainer.classList.add("item-container");
            itemContainer.dataset.id = item.id;
            itemContainer.innerHTML = `
              <div class="column-1">
                  <img class="item-icon" src="${item.image}" alt="Item Image">
                  <div class="add-minus-container">
                      <button class="minus-btn">-</button>
                      <span class="num-of-item">${item.quantity}</span>
                      <button class="add-btn">+</button>
                  </div>
              </div>
              <div class="column-2">
                  <h2 class="item-name">${item.name}</h2>
              </div>
              <div class="column-3">
                  <span class="item-price">$${item.price}</span>
                  <button class="customize-btn">Customize</button>
              </div>
            `;
            const dottedBox = document.createElement("div");
            dottedBox.classList.add("dotted-box");
            itemsContainer.appendChild(itemContainer);
            itemsContainer.appendChild(dottedBox);
            totalPrice += item.price * item.quantity;
            const minusButton = itemContainer.querySelector(".minus-btn");
            minusButton.addEventListener("click", () => {
                let currentCart = JSON.parse(localStorage.getItem("cart") || "[]");
                const targetItem = currentCart.find((cartItem) => cartItem.id === item.id);
                if (targetItem) {
                    if (targetItem.quantity > 1) {
                        targetItem.quantity -= 1;
                    }
                    else {
                        currentCart = currentCart.filter((cartItem) => cartItem.id !== item.id);
                    }
                    localStorage.setItem("cart", JSON.stringify(currentCart));
                    updateCartView(currentCart);
                }
            });
            const addButton = itemContainer.querySelector(".add-btn");
            addButton.addEventListener("click", () => {
                const currentCart = JSON.parse(localStorage.getItem("cart") || "[]");
                const targetItem = currentCart.find((cartItem) => cartItem.id === item.id);
                if (targetItem) {
                    targetItem.quantity += 1;
                    localStorage.setItem("cart", JSON.stringify(currentCart));
                    updateCartView(currentCart);
                }
            });
        });
    }
    else {
        itemsContainer.innerHTML = `
            <div id="no-item-container">
                <img src="/static/styles/images/cart_empty_icon.png">
                <h3>There is no item here</h3>
                <div class="dotted-box"></div>
            </div>
        `;
    }
    totalPriceElement.textContent = `$${totalPrice.toFixed(2)}`;
}
